import {useEffect, useState} from "react";
import LoginObservable from "./LoginObservable";

function Header() {
    const [isLoggedIn, setIsLoggedIn] = useState(false)

    const handleLogin = (value) => {
        setIsLoggedIn(value)
    }

    useEffect(() => {
        LoginObservable.subscribe(handleLogin);

        () => {
            LoginObservable.unsubscribe(handleLogin)
        }
    }, [LoginObservable]);

    return (
        <>
            {isLoggedIn ? (
                <button onClick={() => handleLogin(false)} >Login</button>
            ) : (
                <button onClick={() => handleLogin(false)} >Logout</button>
            )}
        </>
    );
}

export default Header;
